import React from "react";
import { useContext, useState } from "react";
import { TicketContext } from "../contexts/TicketContext";

const TicketDisplay = () => {
  const [tickets, setTickets] = useContext(TicketContext);
  console.log(tickets);

  const push = () => {};

  return (
    <div className="display">
      <div className="backlog">
        <h1>Backlog</h1>
        <div>
          {tickets.map((ticket) => (
            <div>{ticket.status == "backlog" && <li>{ticket.name}</li>}</div>
          ))}
        </div>
      </div>

      <div className="sprint">
        <h1>Sprint</h1>
        <div>
          {tickets.map((ticket) => (
            <div>
              {ticket.status == "sprint" && (
                <div>
                  <li>{ticket.name}</li>
                  <button id={ticket.id} onClick={push(ticket.id)}>
                    click
                  </button>
                </div>
              )}
            </div>
          ))}
        </div>
      </div>
      <div className="progress">
        <h1>Progress</h1>
        <div>
          {tickets.map((ticket) => (
            <div>{ticket.status == "progress" && <li>{ticket.name}</li>}</div>
          ))}
        </div>
      </div>
      <div className="done">
        <h1>Done</h1>
        <div>
          {tickets.map((ticket) => (
            <div>{ticket.status == "done" && <li>{ticket.name}</li>}</div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TicketDisplay;
